import "../css/Contact.css";

export const Contact = () => {
  const handleWhatsAppClick = () => {
    const phoneNumber = "+2290166572465";
    const message = "Bonjour ! Je suis int√©ress√© par vos services de d√©veloppement.";
    const whatsappUrl = `https://wa.me/${phoneNumber}?text=${encodeURIComponent(message)}`;
    window.open(whatsappUrl, '_blank');
  };

  const handleEmailClick = () => {
    const email = "gildasprofessionnel2207@gmail.com";
    const subject = "Demande de contact - Portfolio";
    const body = "Bonjour,\n\nJe suis int√©ress√© par vos services de d√©veloppement.\n\nCordialement,";
